import React from 'react';
import './App.css';

function App() {
  return (
    <div className="bg-slate-200 h-screen flex items-center justify-center">
      <div className="bg-bla p-8 rounded-lg shadow-md">
        <h1 className="text-2xl font-bold mb-4">Hello, Tailwind CSS!</h1>
        <p className="text-red-200">Welcome to your React.js project with Tailwind CSS.</p>
      </div>
    </div>
  );
}

export default App;
